<div class="st-ui-embed st-search-chrome-overlay-output st-search-escape-hide-outputs st-search-zoom-on-mobile" style="display: none;">

    <div class="st-ui-overlay st-search-hide-outputs"></div>

  <!-- Swiftype input and results overlay -->

  <div class="st-ui-container st-ui-container-overlay  st-ui-injected-overlay-container ">
    <!-- HEADER -->
    <div class="st-ui-container-header_bar st-position-container">

        <section class="st-ui-header">
          <form>
            <input class="st-default-search-input st-search-set-focus" type="text" value="" placeholder="{% translate search_placeholder %}" aria-label="{% translate search_placeholder %}" id="st-overlay-search-input" />
          </form>
          <span class="st-ui-search-icon"></span>


            <a class="st-ui-close-button st-search-hide-outputs">Close</a>



        </section>

    </div>

    <!-- LEFT SIDEBAR -->
    <div class="st-ui-container-left_sidebar st-position-container">

      <div class="st-ui-injected-search-controls">



      </div>
    </div>

    <!-- RIGHT SIDEBAR -->
    <div class="st-ui-container-right_sidebar st-position-container">

      <div class="st-ui-injected-container-right_sidebar">
        <div class="st-ui-injected-search-controls">



        </div>
      </div>
    </div>

    <!-- PRIMARY CONTENT -->
    <div class="st-ui-container-primary_content st-position-container">

        <section class="st-ui-slide-autocomplete st-autocomplete-keyboard-navigable st-autocomplete-transient-on-select-and-results" data-st-target-element="#st-overlay-search-input" data-st-active-query-class="active">
          <span class="st-ui-type-heading-small">{% translate suggested_results %}</span>
          <div class="st-autocomplete-results"></div>
        </section>

        <section class="st-ui-content st-search-results">
          <span class="st-ui-fallback"></span>
        </section>


      <section class="st-ui-no-results st-search-suggestions">
      </section>
    </div>



    <!-- FOOTER -->
    <div class="st-ui-container-footer_bar st-position-container">
      <section class="st-ui-footer">

          <span class="st-ui-search-summary st-search-summary" aria-live="polite"></span>

        <span class="st-ui-pagination st-search-pagination"></span>
      </section>
    </div>
  </div>
</div>
<div class="st-default-autocomplete" data-st-target-element=".st-default-search-input" style="display: none;" >
  <div class="st-autocomplete-results st-ui-autocomplete"></div>
</div>
"},"search":{"result_item":{"page":"<a href="{{ full_result.url | escapeUrl | sanitizeXSS }}" class="st-ui-result" data-st-result-doc-id="{{result.doc_id}}">
  <span class="st-ui-type-heading">{{ result.title }}</span>
  <span class="st-ui-type-detail">

      {% if result.sections %}
        <span class="st-ui-type-detail-bold">
          {{ result.sections }}
        </span>
        &nbsp;&#8226;&nbsp;
      {% endif %}

    {{ result.body }}
  </span>
</a>
"},"result_summary":"{% translate result_summary %}
","result_pagination":"{% if num_pages > 1 %}
  {% if current_page > 1 %}
    <a class='st-ui-pagination-link st-result-pagination-link' data-st-page={{ current_page | minus: 1 }} href='#'>
      <span class="st-ui-arrow left-arrow"></span> {% translate previous_page %}
    </a>
  {% endif %}
  {% for page_number in page_numbers %}
    {% if page_number != current_page %}
      <a class='st-ui-pagination-link st-ui-pagination-number-link st-result-pagination-link' data-st-page={{page_number}} href='#'>{{ page_number }}</a>
    {% else %}
      <a class='st-ui-pagination-link st-ui-pagination-number-link st-result-pagination-link active' data-st-page={{page_number}} href='#'>{{ page_number }}</a>
    {% endif %}
  {% endfor %}
  {% if current_page < num_pages %}
    <a class='st-ui-pagination-link st-result-pagination-link' data-st-page={{ current_page | plus: 1 }} href='#'>
      {% translate next_page %} <span class="st-ui-arrow right-arrow"></span>
    </a>
  {% endif %}
{% endif %}
","spelling_suggestion":"{% if spelling_suggestion && total_records_across_all_sets == 0 %}
  <span class="st-ui-type-heading st-spelling-suggestion-link" data-st-search-suggestion="{{ spelling_suggestion.text }}"">{% translate did_you_mean %} &#8220;<a href="#">{{ spelling_suggestion.text }}</a>&#8221;?</span>
{% endif %}
","sort_dropdown":"<select id="st-sort-selector">
  {% for sort_value in sort_values %}
    <option class="st-sort-element" value="{{sort_value.field}}" data-st-document-field="{{sort_value.field}}" data-st-sort-direction="{{sort_value.sort_direction}}">{{sort_value.label}}</option>
  {% endfor %}
</select>
","filter_checkbox":"<form action="">
  {% for facet in facet_data.facets %}
    <div class="st-limited-show-element">
      <input id="{{facet_data.label | downcase | replace:' ','_'}}-{{facet[0]}}" type="checkbox" class="st-filter-element" name="{{facet[0]}}" value="{{facet[0]}}" data-st-filter-values="{{facet[0]}}"> <label for="{{facet_data.label | downcase | replace:' ','_'}}-{{facet[0]}}">
        <span class="st-option-name">{{facet[0]}}</span>
        {% unless facet_data.hide_count %}
          <span class="st-option-count">({{facet[1]}})</span>
        {% endunless %}
      </label>
    </div>
  {% endfor %}
  <a href="#" class="st-facet-expand st-limited-show-action">+ More options</a>
</form>
","filter_predefined_ranges":"<form action="">
  {% for predefined_range in facet_data.predefined_ranges %}
    <a href="#" class="st-filter-element" data-st-filter-from="{{ predefined_range.from }}" data-st-filter-to="{{ predefined_range.to }}">{{ predefined_range.label }}</a>
  {% endfor %}
</form>
","range_slidebar":"{% if facet_data.show %}
  <form action="">
    <input class="st-filter-from" type="hidden" value=""/>
    <input class="st-filter-to" type="hidden" value=""/>
    <input type="text" class="st-filter-range-slidebar" value="" data-min={{facet_data.min_value}} data-max={{facet_data.max_value}} data-type="double">
  </form>
{% endif %}
","range_textbox":"{% capture from_id %}{{ facet_data.label}}_{{ facet_data.from_label }}{% endcapture %}
{% capture to_id %}{{ facet_data.label }}_{{ facet_data.to_label }}{% endcapture %}


<form action="">
  <div class="st-ui-input">
    <label for="{{ from_id | downcase | replace: ' ', '_' | remove: ':' }}" class="st-ui-label st-datepicker">{{facet_data.from_label}}</label>
    <input class="st-filter-from" type="text" autocomplete="off" id="{{ from_id | downcase | replace: ' ', '_' | remove: ':' }}"/>
  </div>
  <div class="st-ui-input">
    <label for="{{ to_id | downcase | replace: ' ', '_' | remove: ':' }}" class="st-ui-label">{{facet_data.to_label}}</label>
    <input class="st-filter-to" type="text" autocomplete="off" id="{{ to_id | downcase | replace: ' ', '_' | remove: ':' }}"/>
  </div>
  <button class="st-filter-element st-ui-submit" href="#">{{ facet_data.submit_label }}</button>
</form>
","range_date":"{% capture from_id %}{{ facet_data.label}}_{{ facet_data.from_label }}{% endcapture %}
